module.exports = [{"id":"docs/getting-started/0.1/introduction/overview","name":"IOTA 概要","summary":"IOTA は、接続されたデバイスが無料でデータと IOTA トークンを相互に転送できるようにするオープンソースの分散型台帳技術です。"},{"id":"docs/getting-started/0.1/introduction/ternary","name":"三進数","summary":"IOTA では、データはトリットとトライトで構成される三進数システムに従って表されます。二進法と比較して、三進法コンピューティングは2つではなく3つの状態のデータを表すことができるため、理論上はより効率的であると考えられています。"},{"id":"docs/client-libraries/0.1/getting-started/quickstart","name":"quickstart","summary":":::info:非開発者の場合\n公式トリニティウォレットを使用して、シードの作成と保存、トランザクションの送受信などを行います。\n:::"},{"id":"docs/wallets/0.1/hub/how-to-guides/quickstart","name":"quickstart","summary":"If you're new to Hub, you can follow this workflow guide to start learning from the beginning."},{"id":"docs/wallets/0.1/trinity/how-to-guides/quickstart","name":"quickstart","summary":"このガイドを最初から最後まで完了すると、トリニティのインストールからトランザクションの送信、カスタムノードへの接続まで、すべてを学習できます。"},{"id":"docs/node-software/0.1/iri/how-to-guides/quickstart","name":"quickstart","summary":"If you're new to IRI, you can follow this workflow guide to start learning from the beginning."},{"id":"docs/getting-started/0.1/tutorials/create-a-seed","name":"シードを作成する","summary":"アドレスのメッセージや IOTA トークンの所有権を証明するには、シードが必要です。このガイドでは、自分自身のシードを作成します。"},{"id":"docs/getting-started/0.1/tutorials/get-test-tokens","name":"テスト IOTA トークンを取得する","summary":"IOTA をテストする場合、IOTA トークンをあるアドレスから別のアドレスに送信できます。メインネットでは、IOTA トークンは取引所で取引できる金銭的価値を持っています。テストトランザクションを送信するには、無料のテストトークンを使用するデブネットを使用できます。"},{"id":"docs/getting-started/0.1/network/iota-networks","name":"IOTA ネットワーク","summary":"IOTA には複数のノードによる2つのパブリックネットワークがあり、各ネットワークにはノードがトランザクションを接続できる独自のタングルがあります。"},{"id":"docs/getting-started/0.1/network/nodes","name":"ノード","summary":"ノードは IOTA ネットワークの中核です。タングルへの読み取りおよび書き込みアクセスを許可するノードソフトウェアを実行します。他の分散システムと同様に、ノードは IOTA ネットワークを形成するためにネイバーと呼ばれる他のノードに接続されます。1つのノードは、世界のどこにいてもトランザクションを受信すると、受信したト..."},{"id":"docs/getting-started/0.1/network/minimum-weight-magnitude","name":"最小重量値(MWM)","summary":" トランザクションに対してプルーフオブワークを行う場合、最小重量値（MWM）を指定できます。これは、実行される作業量を定義します。ノードは、構成に応じて、特定の最小重量値だけを受け入れます。最小重量値が低すぎると、ノードはトランザクションを無効として拒否します。"},{"id":"docs/getting-started/0.1/network/the-tangle","name":"タングル","summary":"タングルは、トランザクションの最新の履歴を含むイミュータブルのデータ構造です。IOTA ネットワーク内のすべてのノードはタングルのコピーを保存し、その内容について合意に達します。"},{"id":"docs/getting-started/0.1/network/the-coordinator","name":"コーディネーター","summary":"コーディネーターは、IOTA 財団によって実行されるアプリケーションであり、その目的はタングルをパラサイトチェーンなどの攻撃から保護することです。ノードは、コーディネーターを使用して、トランザクションが確定されるコンセンサスに到達します。"},{"id":"docs/getting-started/0.1/clients/seeds","name":"シード","summary":"シードとは、アドレスに保持されているメッセージや IOTA トークンの所有権を証明できる一意のパスワードです。"},{"id":"docs/getting-started/0.1/clients/token","name":"IOTA トークン","summary":" IOTA トークンは価値のユニット（i、Ki、Mi、Gi、Ti、Pi）であり、IOTA ネットワーク経由で転送バンドルを介して転送できます。"},{"id":"docs/getting-started/0.1/clients/addresses","name":"アドレス","summary":"アドレスは、シードに属し、IOTA トークンの残高が0以上のアカウントのようなものです。アドレスは、公開/秘密鍵ペアの公開半分です。IOTA トークンをあるアドレスから別のアドレスに転送するには、秘密鍵でトランザクションに署名し、所有していることをノードに証明します。そのため、シード所有者のみが秘密鍵を知っているため、..."},{"id":"docs/getting-started/0.1/clients/checksums","name":"チェックサム","summary":"チェックサムは、アドレスまたはシードの末尾に追加されるトライトに付けられた名前です。多くの場合、ユーザーインターフェイスのアドレスとシードにチェックサムが追加され、タイプミスを検出しやすくなります。"},{"id":"docs/getting-started/0.1/clients/security-levels","name":"セキュリティレベル","summary":"新しいアドレスを生成するとき、セキュリティレベルを指定できます。アドレスのセキュリティレベルは、秘密鍵の長さ、使用済みアドレスが総当り攻撃から保護される度合い、および署名を含めるために必要なトランザクションの数に影響します。"},{"id":"docs/getting-started/0.1/clients/signatures","name":"署名","summary":"署名は、所有権のデジタル証明です。アドレスの所有権を証明するには、秘密鍵でバンドルに署名して、そのバンドル（アドレス）の所有権を私が有していることを他の人が確認できるようにします。"},{"id":"docs/getting-started/0.1/transactions/transactions","name":"トランザクション","summary":"トランザクションは、IOTA トークンをアドレスから取り出したり、アドレスにデポジットしたり、ゼロトークン（データ、メッセージ、または署名を含む）にすることができる単一の転送命令です。IOTA ネットワークに何かを送信する場合は、トランザクションとしてノードに送信する必要があります。"},{"id":"docs/getting-started/0.1/transactions/bundles","name":"バンドル","summary":"バンドルは、互いの有効性に依存するトランザクションのグループです。たとえば、IOTA トークンをアドレス A へデポジットするトランザクションは、アドレス B から IOTA トークンを取り出すトランザクションに依存しています。したがって、これらのトランザクションは同じバンドル内にある必要があります。"},{"id":"docs/getting-started/0.1/transactions/proof-of-work","name":"プルーフオブワーク","summary":"プルーフオブワーク（PoW）は、特定の要件を満たすために試行錯誤を使用して計算されるデータです。hashcash などのスパム防止対策として、各トランザクションが有効であるためにプルーフオブワークを含める必要があります。このプルーフオブワークは実行が困難ですが、ノードが検証するのは簡単です。"},{"id":"docs/getting-started/0.1/transactions/depth","name":"深度","summary":"ノードにトランザクションを送信する場合、深度引数を指定できます。これは、ノードがチップ選択アルゴリズムを開始する過去のマイルストーン数を定義します。深度が大きいほど、タングル内のより深くからチップ選択が開始されます。深度が大きくなると、ノードがチップの選択を完了するのにかかる時間が長くなり、計算能力が高くなります。"},{"id":"docs/getting-started/0.1/transactions/reattach-rebroadcast-promote","name":"再アタッチ、再ブロードキャスト、プロモート","summary":"タングル上のトランザクションは、ネットワークの負荷の増加や、一貫性のないサブタングルに接続されている場合など、多くの理由でペンディング状態のままになる場合があります。バンドルが確定される可能性を高めるために、バンドルを再アタッチ、再ブロードキャスト、またはプロモートできます。"},{"id":"docs/getting-started/0.1/references/quickstart-dev-handbook","name":"IOTA 開発者ハンドブック","summary":"このハンドブックでは、IOTA テクノロジーの概要を説明し、あなた自身のアプリケーションで IOTA テクノロジーをどのように活用できるかを特定するのに役立ちます。"},{"id":"docs/getting-started/0.1/references/glossary","name":"用語集","summary":"サブグラフマイルストーントランザクションとチップトランザクションの間のすべてのトランザクションを含む台帳のセクション"},{"id":"docs/client-libraries/0.1/introduction/overview","name":"クライアントライブラリ概要","summary":"IOTA クライアントライブラリを使用すると、IOTA を自分自身のアプリケーションに簡単に統合できます。IOTA クライアントライブラリを使用して、トランザクションを作成、送信、受信、およびリクエストできます。"},{"id":"docs/client-libraries/0.1/getting-started/quickstart","name":"クライアントライブラリ入門","summary":":::info:非開発者の場合\n公式トリニティウォレットを使用して、シードの作成と保存、トランザクションの送受信などを行います。\n:::"},{"id":"docs/client-libraries/0.1/getting-started/c-quickstart","name":"C quickstart","summary":"In this quickstart, you learn the basics of IOTA development in C, from setting up a development environment to listening for live transaction on the Tangle."},{"id":"docs/client-libraries/0.1/getting-started/go-quickstart","name":"Go クイックスタート","summary":"このクイックスタートでは、開発環境の設定からタングル上のライブトランザクションのリッスンまで、GoでのIOTA開発の基本を学びます。"},{"id":"docs/client-libraries/0.1/getting-started/java-quickstart","name":"Java クイックスタート","summary":"このクイックスタートでは、開発環境の設定からタングルでのライブトランザクションのリッスンまで、Java での IOTA 開発の基本を学びます。"},{"id":"docs/client-libraries/0.1/getting-started/js-quickstart","name":"Node.js クイックスタート","summary":"このクイックスタートでは、開発環境の設定からタングルでのライブトランザクションのリッスンまで、Node.js での IOTA 開発の基本を学びます。"},{"id":"docs/client-libraries/0.1/getting-started/python-quickstart","name":"Python クイックスタート","summary":"このクイックスタートでは、開発環境のセットアップからタングルでのライブトランザクションのリッスンまで、Python での IOTA 開発の基本を学びます。"},{"id":"docs/client-libraries/0.1/how-to-guides/c/get-started","name":"Get started with the C client library","summary":"To help you get started with the C client library, this workflow guide walks you through the essentials from sending a zero-value transaction to transferring IO..."},{"id":"docs/client-libraries/0.1/how-to-guides/c/send-your-first-bundle","name":"Send a \"hello world\" transaction in C","summary":"In this guide, you send a \"hello world\" message in a zero-value transaction. These transactions are useful for storing messages on the Tangle without having to ..."},{"id":"docs/client-libraries/0.1/how-to-guides/c/read-transactions","name":"Read transactions from the Tangle in C","summary":"In this guide, you get transactions from the Tangle by connecting to a node and asking it to filter them by their addresses. Then, you decode the message in the..."},{"id":"docs/client-libraries/0.1/how-to-guides/c/generate-an-address","name":"Generate an address in C","summary":"In this guide, you learn how to generate a new address for a seed with a given security level."},{"id":"docs/client-libraries/0.1/how-to-guides/c/transfer-iota-tokens","name":"Send a micropayment in C","summary":"In this guide, you send a micropayment of 1 IOTA by sending a transfer bundle to a node."},{"id":"docs/client-libraries/0.1/how-to-guides/c/check-balance","name":"Check the balance of an address in C","summary":"In this guide, you request the balance of IOTA tokens on addresses from a node."},{"id":"docs/client-libraries/0.1/how-to-guides/go/get-started","name":"Go クライアントライブラリ入門","summary":"Go クライアントライブラリの使用を開始するために、このワークフローガイドでは、ゼロトークントランザクションの送信、IOTA トークンの転送、ライブタングルデータのためのノードのモニタリングまでの基本事項を説明します。"},{"id":"docs/client-libraries/0.1/how-to-guides/go/send-your-first-bundle","name":"Go で \"hello world\" トランザクションを送信する","summary":"このガイドでは、ゼロトークントランザクションで \"hello world\" メッセージを送信します。ゼロトークントランザクションは、IOTA トークンを送信することなくタングルにメッセージを保存するのに役立ちます。"},{"id":"docs/client-libraries/0.1/how-to-guides/go/read-transactions","name":"Go でタングルからトランザクションを読み取る","summary":"このガイドでは、ノードに末尾トランザクションハッシュを与えることで、タングルから \"hello world\" トランザクションを読み取ります。"},{"id":"docs/client-libraries/0.1/how-to-guides/go/generate-an-address","name":"Go でアドレスを生成する","summary":"このガイドを完了するには、以下のパッケージをインストールする必要があります（Go モジュールを使用している場合は、以下のパッケージを参照するだけです）。"},{"id":"docs/client-libraries/0.1/how-to-guides/go/transfer-iota-tokens","name":"Go でマイクロペイメントを送信する","summary":"このガイドを完了するには、以下のパッケージをインストールする必要があります（Go モジュールを使用している場合は、以下のパッケージを参照するだけです）。"},{"id":"docs/client-libraries/0.1/how-to-guides/go/check-balance","name":"Go でアドレスの残高を確認する","summary":"このガイドを完了するには、以下のパッケージをインストールする必要があります（Go モジュールを使用している場合は、以下のパッケージを参照するだけです）。"},{"id":"docs/client-libraries/0.1/how-to-guides/go/listen-for-transactions","name":"Go でライブトランザクションをリッスンする","summary":"このガイドでは、IRI ノードソフトウェアを実行するノードのゼロメッセージキュー（ZMQ）にサブスクライブして、タングル上の最近のトランザクションをリッスンします。"},{"id":"docs/client-libraries/0.1/how-to-guides/java/get-started","name":"Java クライアントライブラリ入門","summary":" Java クライアントライブラリの使用を開始するために、このワークフローガイドでは、ゼロトークントランザクションの送信から IOTA トークンの転送、ライブタングルデータのためのノードのモニタリングまでの基本事項を説明します。"},{"id":"docs/client-libraries/0.1/how-to-guides/java/send-your-first-bundle","name":"Java で \"hello world\" トランザクションを送信する","summary":"このガイドでは、ゼロトークントランザクションで \"hello world\" メッセージを送信します。ゼロトークントランザクションは、IOTA トークンを送信することなくタングルにメッセージを保存するのに役立ちます。"},{"id":"docs/client-libraries/0.1/how-to-guides/java/read-transactions","name":"Java でタングルからトランザクションを読み取る","summary":"このガイドでは、ノードに末尾トランザクションハッシュを与えることで、タングルから \"hello world\" トランザクションを読み取ります。"},{"id":"docs/client-libraries/0.1/how-to-guides/java/generate-an-address","name":"Java でアドレスを生成する","summary":"接続されたノードは、指定されたインデックスから開始して、次の操作を実行してアドレスが使用されているかどうかを確認します。"},{"id":"docs/client-libraries/0.1/how-to-guides/java/transfer-iota-tokens","name":"Java でマイクロペイメントを送信する","summary":"テスト IOTA トークンをデブネットで送信するには、ノードはシードに属するアドレスの1つにおいて0より大きい残高のレコードを持っている必要があります。デブネットで使用するテスト IOTA トークンを取得するには、デブネット蛇口を使用できます。"},{"id":"docs/client-libraries/0.1/how-to-guides/java/check-balance","name":"Java でアドレスの残高を確認する","summary":"また、Maven ビルドツールを使用する Java 開発環境も必要です。Java クライアントライブラリを初めて使用する場合は、スタートガイドを完了し、Maven でライブラリをインストールするための指示に従ってください。"},{"id":"docs/client-libraries/0.1/how-to-guides/java/listen-for-transactions","name":"Java でライブトランザクションをリッスンする","summary":"このガイドでは、IRI ノードソフトウェアを実行するノードのゼロメッセージキュー（ZMQ）にサブスクライブして、タングル上の最近のトランザクションをリッスンします。"},{"id":"docs/client-libraries/0.1/how-to-guides/js/get-started","name":"JavaScript クライアントライブラリ入門","summary":"JavaScript クライアントライブラリの使用を開始するために、このワークフローガイドでは、ゼロトークントランザクションの送信から IOTA トークンの転送、ライブタングルデータのためのノードのモニタリングまでの基本事項を順を追って説明します。"},{"id":"docs/client-libraries/0.1/how-to-guides/js/send-your-first-bundle","name":"Node.js で \"hello world\" トランザクションを送信する","summary":"このガイドでは、ゼロトークントランザクションを用いて \"hello world\" メッセージを送信します。ゼロトークントランザクションは、IOTA トークンを送信することなくタングルにメッセージを保存するのに役立ちます。"},{"id":"docs/client-libraries/0.1/how-to-guides/js/read-transactions","name":"Node.js でタングルからトランザクションを読み取る","summary":"このガイドでは、ノードに末尾トランザクションハッシュを与えることで、タングルから \"hello world\" トランザクションを読み取ります。"},{"id":"docs/client-libraries/0.1/how-to-guides/js/generate-an-address","name":"Node.js でアドレスを生成する","summary":"接続されたノードは、指定されたインデックスから開始して、以下の操作を実行してアドレスが使用されているかどうかを確認します。"},{"id":"docs/client-libraries/0.1/how-to-guides/js/transfer-iota-tokens","name":"Node.js でマイクロペイメントを送信する","summary":"テスト IOTA トークンをデブネットで送信するには、ノードはシードに属するアドレスの1つにおいて0より大きい残高のレコードを持っている必要があります。デブネットで使用するテスト IOTA トークンを取得するには、デブネット蛇口を使用できます。"},{"id":"docs/client-libraries/0.1/how-to-guides/js/check-balance","name":"Node.js でアドレスの残高を確認する","summary":""},{"id":"docs/client-libraries/0.1/how-to-guides/js/listen-for-transactions","name":"Node.js でライブトランザクションをリッスンする","summary":"このガイドでは、IRI ノードソフトウェアを実行するノードのゼロメッセージキュー（ZMQ）にサブスクライブして、タングル上の最近のトランザクションをリッスンします。"},{"id":"docs/client-libraries/0.1/how-to-guides/js/check-transaction-confirmation","name":"トランザクションが確定したか確認する","summary":"IOTA トークンを転送する前に、IOTA トークンを転送するバンドルのトランザクションを確定する必要があります。バンドル内のトランザクションは、末尾トランザクションがマイルストーンによって参照および承認されるまでペンディング状態のままです。"},{"id":"docs/client-libraries/0.1/how-to-guides/js/confirm-pending-bundle","name":"バンドルが確定するのを助ける","summary":"あるトランザクションがマイルストーンによって参照されるためには、チップ選択時にそのトランザクションが選択される必要があります。これにより、古いトランザクションよりも新しいトランザクションが優先されます。バンドルがペンディング状態に留まる時間が長いほど、確定される可能性は低くなります。バンドルが確定される可能性を高めるた..."},{"id":"docs/client-libraries/0.1/how-to-guides/js/derive-addresses-from-private-keys","name":"秘密鍵とアドレスを生成する","summary":"秘密鍵からアドレスを導出することにより、アドレス、秘密鍵、およびセキュリティレベル間の関係をより深く理解できます。"},{"id":"docs/client-libraries/0.1/how-to-guides/js/convert-data-to-trytes","name":"データをトライトへ、トライトをデータへ変換する","summary":"トランザクションフィールドの値はトライトで表す必要があります。データ変換を容易にするために、IOTA クライアントライブラリには、データをトライト、トリット、およびASCII文字との間で変換するための組み込み関数があります。"},{"id":"docs/client-libraries/0.1/how-to-guides/python/get-started","name":"Python クライアントライブラリ入門","summary":"Python クライアントライブラリの使用を開始するために、このワークフローガイドでは、ゼロトークントランザクションの送信から IOTA トークンの転送、ライブタングルデータのためのノードのモニタリングまで、基本事項を順を追って説明します。"},{"id":"docs/client-libraries/0.1/how-to-guides/python/send-your-first-bundle","name":"Python で \"hello world\" トランザクションを送信する","summary":"このガイドでは、ゼロトークントランザクションを用いて \"hello world\" メッセージを送信します。ゼロトークントランザクションは、IOTA トークンを送信することなくタングルにメッセージを保存するのに役立ちます。"},{"id":"docs/client-libraries/0.1/how-to-guides/python/read-transactions","name":"Python でタングルからトランザクションを読み取る","summary":"このガイドでは、ノードに末尾トランザクションハッシュを与えることで、タングルから \"hello world\" トランザクションを読み取ります。"},{"id":"docs/client-libraries/0.1/how-to-guides/python/generate-an-address","name":"Python でアドレスを生成する","summary":"get_new_addresses メソッドを使用して、未使用のアドレスを生成します。接続されたノードに、指定されたインデックスのアドレスから IOTA トークンの取り出しを行う入力トランザクションがある場合、ノードはそのアドレスが使用済みアドレスであることを認識しているため、ライブラリは次の未使用アドレスを返します。"},{"id":"docs/client-libraries/0.1/how-to-guides/python/check-balance","name":"Python でアドレスの残高を確認する","summary":"シードを定義します。このシードを、テスト IOTA トークンを持つアドレスを所有するシードに置き換えます。"},{"id":"docs/client-libraries/0.1/how-to-guides/python/transfer-iota-tokens","name":"Python でマイクロペイメントを送信する","summary":"テスト IOTA トークンをデブネットで送信するには、ノードはシードに属するアドレスの1つにおいて0より大きい残高のレコードを持っている必要があります。デブネットで使用するテスト IOTA トークンを取得するには、デブネット蛇口を使用できます。"},{"id":"docs/client-libraries/0.1/how-to-guides/python/listen-for-transactions","name":"Python でライブトランザクションをリッスンする","summary":"このガイドでは、IRI ノードソフトウェアを実行するノードのゼロメッセージキュー（ZMQ）にサブスクライブして、タングル上の確定済みトランザクションをリッスンします。"},{"id":"docs/client-libraries/0.1/account-module/introduction/overview","name":"アカウントモジュール概要","summary":"アカウントモジュールは、使用済みアドレスからの取り出しやペンディング中のトランザクションのプロモートと再アタッチを心配することなく、IOTA の支払いを簡素化するステートフルパッケージです。"},{"id":"docs/client-libraries/0.1/account-module/go/get-started","name":"Go アカウントモジュール入門","summary":"Go アカウントモジュールの使用を開始するために、このワークフローガイドでは、アカウントの作成から支払いの実行、シードステートのエクスポートまでの基本事項を順を追って説明します。"},{"id":"docs/client-libraries/0.1/account-module/go/create-account","name":"Go でアカウントを作成する","summary":"このガイドでは、ローカルデータベースでシードステートを追跡するためのアカウントを作成し、アカウントの残高をコンソールに出力します。"},{"id":"docs/client-libraries/0.1/account-module/go/create-plugin","name":"Go でアカウントプラグインを作成する","summary":"プラグインはアカウントの機能を拡張します。このガイドでは、アカウントのイベントをコンソールに出力するプラグインを作成します。"},{"id":"docs/client-libraries/0.1/account-module/go/generate-cda","name":"Go で条件付きデポジットアドレスを生成する","summary":"このガイドでは、条件付きデポジットアドレスを生成し、マグネットリンクにシリアル化し、テスト IOTA トークンを送信します。"},{"id":"docs/client-libraries/0.1/account-module/go/make-payment","name":"Go でアカウントで支払いを行う","summary":"このガイドでは、アカウントを使用して IOTA トークンを事前定義された CDA にデポジットします。"},{"id":"docs/client-libraries/0.1/account-module/go/export-seed-state","name":"Go で既存のシードステートのインポート、エクスポートを行う","summary":"アカウントを使用して支払いを行うと、アカウントはシードステートを更新します。このガイドでは、アカウントのシードステートをエクスポートして、別のデバイスにインポートしたり、単にバックアップしたりできるようにする方法を学習します。"},{"id":"docs/client-libraries/0.1/account-module/go/listen-to-events","name":"Go でアカウントイベントをリッスンする","summary":"アカウントオブジェクトは、イベントが発生するとイベントを発行します。イベントの例は、支払いを行うか支払いを受け取る場合です。このガイドでは、これらのイベントをリッスンし、コンソールに記録します。"},{"id":"docs/client-libraries/0.1/account-module/go/combine-balance","name":"Go で残高を1つの CDA にまとめる","summary":"残高の大半をできるだけ少ない CDA に保持することをお勧めします。これにより、支払いがより高速になり、必要なトランザクションが少なくなります。このガイドでは、利用可能な残高全体を新しいCDAに移行します。"},{"id":"docs/client-libraries/0.1/account-module/java/get-started","name":"Get started with the account module in Java","summary":"To help you get started with the Java account module, this workflow guide walks you through the essentials from creating an account to making payments and expor..."},{"id":"docs/client-libraries/0.1/account-module/java/create-account","name":"Java でアカウントを作成する","summary":":::info:\n既存のシードは、シードステートが不明であるため、使用することは安全ではありません。既存のシードは、アカウントが認識していない使用済みアドレスを持っている場合が有ります。\n:::"},{"id":"docs/client-libraries/0.1/account-module/java/create-plugin","name":"Java でアカウントプラグインを作成する","summary":"プラグインはアカウントの機能を拡張します。このガイドでは、アカウントのイベントをコンソールに出力するプラグインを作成します。"},{"id":"docs/client-libraries/0.1/account-module/java/generate-cda","name":"Generate a conditional deposit address in Java","summary":"In this guide, you generate a conditional deposit address, serialize it into a magnet link, and send test IOTA tokens to it."},{"id":"docs/client-libraries/0.1/account-module/java/make-payment","name":"Make payments with your account in Java","summary":"In this guide, you use your account to deposit IOTA tokens into a pre-defined CDA."},{"id":"docs/client-libraries/0.1/account-module/java/export-seed-state","name":"Import/export an existing seed state in Java","summary":"When you use your account to make payments, your account updates your seed state. In this guide, you learn how to export your account's seed state so that you c..."},{"id":"docs/client-libraries/0.1/account-module/java/listen-to-events","name":"Javaを用いてアカウントのイベントをリッスンする","summary":"アカウントオブジェクトは、イベントが発生するとイベントを発行します。イベントの例は、支払いを行うか受け取る場合です。このガイドでは、支払いを行ったり、受け取ったりするイベントをリッスンし、コンソールにログします。"},{"id":"docs/client-libraries/0.1/account-module/java/combine-balance","name":"Java で残高を1つの CDA にまとめる","summary":"残高の大半をできるだけ少ない CDA に保持することをお勧めします。これにより、支払いがより高速になり、必要なトランザクションが少なくなります。このガイドでは、利用可能な残高全体を新しいCDAに移行します。"},{"id":"docs/client-libraries/0.1/account-module/js/get-started","name":"Get started with the account module in JavaScript","summary":"To help you get started with the JavaScript account module, this workflow guide walks you through the essentials from creating an account to making payments and..."},{"id":"docs/client-libraries/0.1/account-module/js/create-account","name":"Create an account in JavaScript","summary":"In this guide, you create an account to keep track of your seed state in a local database and learn how to display your available balance."},{"id":"docs/client-libraries/0.1/account-module/js/listen-to-events","name":"JSを用いてアカウント内のイベントをリッスンする","summary":"An account object emits events when they happen. An example of an event is when you make or receive a payment. In this guide, you listen for these events and lo..."},{"id":"docs/client-libraries/0.1/account-module/js/generate-cda","name":"Generate a conditional deposit address in JavaScript","summary":"Generate a conditional deposit address in JavaScript"},{"id":"docs/client-libraries/0.1/account-module/js/make-payment","name":"Make payments with your account in JavaScript","summary":"In this guide, you use your account to deposit IOTA tokens into a pre-defined CDA."},{"id":"docs/client-libraries/0.1/account-module/js/export-seed-state","name":"Import/export an existing seed state in JavaScript","summary":"Import/export an existing seed state in JavaScript"},{"id":"docs/client-libraries/0.1/account-module/js/combine-balance","name":"Combine your balance into one CDA in JavaScript","summary":"You may want to keep the majority of your balance on as few CDAs as possible. This way, making payments is faster and requires fewer transactions. In this guide..."},{"id":"docs/client-libraries/0.1/mam/introduction/overview","name":"マスクされた認証済みメッセージング","summary":"マスクされた認証済みメッセージング（Masked Authenticated Messaging, MAM）は、タングルのトランザクションでチャネルと呼ばれる暗号化されたデータストリームを公開できるデータ通信プロトコルです。"},{"id":"docs/client-libraries/0.1/mam/js/create-public-channel","name":"パブリックメッセージを発行する","summary":"誰でも読むことができるチャネルにメッセージを発行したい場合は、パブリックチャネルを使用できます。パブリックチャネルは、すべてのユーザーに対して開かれているトランザクションのアドレスを使用して、すべてのユーザーがメッセージを見つけて復号化できるように開いています。パブリックチャネルは、データをイミュータブルにする公示また..."},{"id":"docs/client-libraries/0.1/mam/js/create-restricted-channel","name":"制限付きメッセージを発行する","summary":"許可されたユーザーのみが閲覧できるチャンネルに秘密のメッセージを公開したい場合は、制限付きチャネルを使用できます。制限付きチャネルはすべてのユーザーが検索できるように開いていますが、サイドキーを持つユーザーのみが復号化できます。このタイプのチャネルは、プライベート通信に役立ちます。"},{"id":"docs/client-libraries/0.1/mam/js/create-mam-webpage","name":"Webページで公開メッセージを発行および表示する","summary":"mamパッケージには、Webページで使用できる縮小されたJavaScriptファイルがあります。これにより、MAMメッセージを発行して表示するWebアプリケーションを構築できます。"},{"id":"docs/client-libraries/0.1/mam/api-reference/mam-api-reference","name":"マスクされた認証済みメッセージング（MAM）API","summary":"これにより、ステートが初期化されます。これは、あなたがフォローしているチャネルの進行状況を追跡するステートオブジェクトを返します。"},{"id":"docs/smartcity/0.1/introduction/overview","name":"overview","summary":"AstroPiOTAは、タングルを使用してローカル環境データを追跡するためにMAMに接続されている国際宇宙ステーションからのAstroPiのクローンです。地球上で、AstroPiOTAはローカルの天気予報を理解し報告するのを助け、地震予知に役立つかもしれません。"},{"id":"docs/node-software/0.1/introduction/overview","name":"ノードソフトウェア","summary":"IOTAネットワークは、同じノードソフトウェアを実行する相互接続されたノードで構成されます。このソフトウェアは、ノードにタングルへの読み取り/書き込みアクセスを許可し、トランザクションを検証し、ノードのローカル台帳にトランザクションを保存できるようにします。"},{"id":"docs/node-software/0.1/iri/introduction/overview","name":"IOTAリファレンス実装概要","summary":"IRI（IOTAリファレンス実装）は、パブリックIOTAネットワークのノードで現在実行されているIOTAプロトコルを定義するオープンソースのJavaソフトウェアであり、クライアントは相互にIOTAトークンを転送できます。"},{"id":"docs/node-software/0.1/iri/concepts/transaction-validation","name":"IRIノードでのトランザクション検証","summary":"IRIノードが新しいトランザクションを受信すると、トランザクションバリデータはトランザクションの以下のことをチェックします。"},{"id":"docs/node-software/0.1/iri/concepts/local-snapshot","name":"ローカルスナップショット","summary":"ローカルスナップショットは、IRIノードが台帳の状態をスナップショットファイルに記録するプロセスです。 IRIノードがスナップショットの実行を開始するには、特定のマイルストーンから始めて、隣接ノードと台帳を同期させる必要があります。 IRIの各バージョンには、ノードがスナップショットを開始できるハードコードされたマイル..."},{"id":"docs/node-software/0.1/iri/concepts/tip-selection","name":"チップ選択","summary":"タングル内の各トランザクションは、前の2つのトランザクションを参照しなければなりません。チップ選択は、ノードが自身の台帳の部分グラフから2つのランダムなチップトランザクションを選択するプロセスです。クライアントがgetTransactionsToApproveエンドポイントを呼び出すと、ノードはチップ選択を行います。"},{"id":"docs/node-software/0.1/iri/how-to-guides/quickstart","name":"Get started with IRI","summary":"If you're new to IRI, you can follow this workflow guide to start learning from the beginning."},{"id":"docs/node-software/0.1/iri/how-to-guides/install-iri","name":"IRIノードを実行する","summary":"IRIノードを実行することにより、タングル上でトランザクションを検証することにより、IOTAネットワークがより分散されるように支援します。"},{"id":"docs/node-software/0.1/iri/how-to-guides/set-up-a-reverse-proxy","name":"リバースプロキシサーバーを設定する","summary":"クライアントは、APIリクエストをスパミングすることによって、IRIノードのオープンAPIポートを悪用することができます。IPアドレスでAPIリクエストを制限したり、APIリクエストの数を制限したりするには、IRIノードをリバースプロキシサーバーに接続します。"},{"id":"docs/node-software/0.1/iri/how-to-guides/prune-transactions-from-the-ledger","name":"台帳からトランザクションを刈り取る","summary":"時間が経つにつれて、IRIノードの台帳には多くのトランザクションが蓄積され、多くの場合、IRIノードの使用可能メモリよりも大きくなります。台帳が大きくなり過ぎないようにするために、定期的に台帳から古いトランザクションを削除することを選択できます。"},{"id":"docs/node-software/0.1/iri/how-to-guides/find-neighbor-iri-nodes","name":"隣接ノードを見つける","summary":"台帳のトランザクションをネットワークの残りの部分と同期するには、ノードが隣接ノードと通信する必要があります。同じネットワーク上の隣接ノードを見つけるには、隣接ノードの所有者に隣接ノードのURLまたはIPアドレスを尋ねて、かつ自分のノードのURLまたはIPアドレスを相手に与える必要があります。"},{"id":"docs/node-software/0.1/iri/how-to-guides/get-started-with-the-api","name":"ノードにリクエストを送信する","summary":"ノードは、PORT設定パラメーターに設定されているAPIポートでクライアントからのトランザクションを受信します。このポートにHTTPリクエストを送信して、ノードのREST APIとやり取りすることができます。これにより、タングルに対してデータの読み書きを行うことができます。"},{"id":"docs/node-software/0.1/iri/how-to-guides/flink-tangle-stream-processing","name":"Apache Flinkを使用してZMQイベントをほぼリアルタイムで処理する","summary":"ZMQイベントを購読すると、ノードからほぼリアルタイムでタングルデータを受信できます。このデータを処理するために、オープンソースのApache Flinkなどのストリーム処理フレームワークを使用できます。"},{"id":"docs/node-software/0.1/iri/how-to-guides/install-a-pow-proxy","name":"プルーフオブワーク用プロキシサーバをインストールする","summary":"attachToTangleエンドポイントはリソースを大量に消費します。結果として、attachToTangleエンドポイントへの多くの呼び出しは時々ノードをクラッシュさせることがあります。この問題を解決するには、専用のプロキシサーバーをインストールして、ノードのプルーフオブワーク（PoW）を行います。"},{"id":"docs/node-software/0.1/iri/how-to-guides/update-the-iri","name":"IRIを更新する","summary":"新しいバージョンのIRIがGitHubでリリースされたら、ローカルのIRIを新しいバージョンに更新することをお勧めします。"},{"id":"docs/node-software/0.1/iri/references/api-reference","name":"APIリファレンス","summary":":::warning:\nこのAPIはベータ版であり、変更される可能性があります。運用版アプリケーションではこのAPIを使用しないことをお勧めします。\n:::"},{"id":"docs/node-software/0.1/iri/references/api-errors","name":"APIエラーメッセージ","summary":"APIリクエストが失敗すると、レスポンスボディにHTTPエラーコードとJSONオブジェクトが返されます。"},{"id":"docs/node-software/0.1/iri/references/best-practice","name":"ノードを実行するためのベストプラクティス","summary":"ノードを実行すると、信頼性の高いアーキテクチャを設定するためのさまざまなオプションがあります。この記事はIOTA財団がIOTA財団のパートナーにしばしば与えるいくつかのアドバイスを与えます。"},{"id":"docs/node-software/0.1/iri/references/data-in-the-ledger","name":"台帳内のデータ構造","summary":"次の表に、IRIノードがtransaction-metadataカラムに追加するメタデータを示します。"},{"id":"docs/node-software/0.1/iri/references/data-in-the-snapshot-metadata-file","name":"スナップショットメタデータファイルのデータ構造","summary":"この表には、ローカルスナップショット中にsnapshot.metaファイルに追加されるデータが含まれています。"},{"id":"docs/node-software/0.1/iri/references/iri-configuration-options","name":"IRI構成オプション","summary":"IRI構成オプションを使用すると、ノードの動作をカスタマイズできます。これらのオプションは、コマンドライン（CLフラグ）または.ini構成ファイル（構成ファイルパラメーター）で設定できます。"},{"id":"docs/node-software/0.1/iri/references/zmq-events","name":"ZMQイベント","summary":"すべてのイベントは、スペースで区切られたデータを含む1つ以上のバッファーオブジェクトを返します。 バッファの最初の項目は常にイベントの名前です。返されたデータ列の情報は、バッファが文字列に変換され、スペース文字で配列に分割されたかのように表示されます。"},{"id":"docs/node-software/0.1/chronicle/introduction/overview","name":"Chronicle 概要","summary":"Chronicle は、IRI ノードに到達するすべてのトランザクションを安全で拡張性の高い分散データベースに保存できるパーマノードソリューションです。"},{"id":"docs/node-software/0.1/chronicle/how-to-guides/get-started","name":"Linuxサーバーでクロニクルを実行する","summary":"クロニクルを実行すると、1つ以上のIRIノードでトランザクションイベントを購読し、そのトランザクションデータをScyllaDBクラスターに保存します。このようにして、ローカルスナップショット中にIRIノードがいつ台帳からプルーニングするかに関係なく、すべてのトランザクションデータが保存されます。"},{"id":"docs/node-software/0.1/chronicle/references/api-reference","name":"API","summary":"このリストには、HTTP APIを介してScyllaクラスターと通信するためのコマンドが含まれています。"},{"id":"docs/node-software/0.1/chronicle/references/architecture","name":"クロニクルアーキテクチャー","summary":"1つのクロニクルノードがScyllaスウォームのすべてのシャードを管理および監督します。これは、各シャードへの少なくとも1つの独立した接続を確立することによって行われます。これは、アンブレラプロジェクトのコアアプリによって監視されます。"},{"id":"docs/node-software/0.1/chronicle/references/data-model","name":"Scyllaデータモデル","summary":"bundle_hash：メインパーティションキー。同じバンドルハッシュを持つすべてのバンドルは、同じパーティションに保存され、同じレプリカに複製されます。"},{"id":"docs/node-software/0.1/chronicle/references/design-goals","name":"設計目標","summary":"IOTAのデータ整合性は、コンセンサスを通じて検証されます。クロニクルからのデータは、信頼できるノードのクォーラムを照会し、その結果を比較することで検証できます。"},{"id":"docs/node-software/0.1/goshimmer/introduction/overview","name":"GoShimmer","summary":"GoShimmerは、ノードがコーディネーターなしでコンセンサスに到達できるようにするノードソフトウェアの進行中のプロトタイプであり、IOTAネットワークの分散化を可能にします。"},{"id":"docs/node-software/0.1/goshimmer/how-to-guides/run-the-node","name":"GoShimmerノードを実行する","summary":"GoShimmerソフトウェアを実行すると、デバイスがプロトタイプネットワークのノードになります。ノードを実行することにより、ネットワークをテストし、定期的な変更を最新の状態に保つことができます。すべてのモジュールが使用可能になると、このネットワークは、次のIOTAプロトコルのリリース候補となります。"},{"id":"docs/node-software/0.1/goshimmer/how-to-guides/send-spam","name":"ノードにスパムトランザクションを送信する","summary":"ノードが1秒間に処理できるトランザクション数をテストするには、spammerAPIエンドポイントを使用してスパムトランザクションを送信します。"},{"id":"docs/node-software/0.1/goshimmer/how-to-guides/subscribe-to-events","name":"ノードの着信トランザクションを監視する","summary":"ノードがトランザクションを受信すると、ノードは受信したトランザクションをトランザクションイベントとしてゼロメッセージキュー（ZMQ）と呼ばれるサービスに発行します。クライアントとして、このイベントを購読して、ノードの着信トランザクションを監視することができます。"},{"id":"docs/node-software/0.1/goshimmer/references/command-line-flags","name":"コマンドラインフラグ","summary":"GoShimmerコードを実行するコマンドでは、以下のフラグを渡してノードのデフォルトの動作を変更できます。たとえば、デフォルトの自動ピアリングポートを変更するように選択できます。"},{"id":"docs/compass/0.1/introduction/overview","name":"プライベートタングル概要","summary":"プライベートタングルは運用者が管理するIOTAネットワークで、運用者が知っているノードだけを含みます。プライベートタングルは、パブリックIOTAネットワークと同じテクノロジを使用しますが、コンパスと呼ばれるコーディネータのオープンソース実装を実行してプライベートタングルを制御します。コンパスを使用すると、プライベートタ..."},{"id":"docs/compass/0.1/how-to-guides/set-up-a-private-tangle","name":"プライベートタングルを設定する","summary":"プライベートタングルは運用者がコントロールするもので、運用者が知っているノードだけを含みます。パブリックタングル内のトランザクションを見ることができるMainnetやDevnetなどのパブリックIOTAネットワークを使用せずにアプリケーションをテストしたい場合は、プライベートタングルを設定します。"},{"id":"docs/compass/0.1/references/compass-configuration-options","name":"コンパス構成オプション","summary":"コンパス構成オプションを使用すると、ニーズに応じてプライベートタングルをカスタマイズできます。たとえば、特定のテスト用に軽量のプライベートタングルを作成したり、メインネットに似た、よりリソース集約型のプライベートタングルを作成したりすることができます。"},{"id":"docs/compass/0.1/references/merkle-tree-compute-times","name":"マークル木計算時間","summary":"マークル木の計算にかかる時間を把握するために、Amazon Web Services 上の仮想プライベートサーバのインスタンス（T2.Xlarge）でテストを行いました。"},{"id":"docs/compass/0.1/references/troubleshooting","name":"トラブルシューティング","summary":"コンパスで IOTA ネットワークを作成している間に、これらの問題のいくつかを見つけるかもしれません。"},{"id":"docs/wallets/0.1/introduction/overview","name":"ウォレット","summary":"ウォレットはシードを保存し、データベースにトランザクションの記録を保存するアプリケーションです。ウォレットを使用すると、シードの保護、トランザクションの送信、および残高の管理のプロセスを簡素化できます。"},{"id":"docs/wallets/0.1/trinity/introduction/overview","name":"トリニティ概要","summary":"トリニティは、データとIOTAトークンを転送できるユーザーインターフェイスを備えたモバイルおよびデスクトップアプリケーションです。トリニティを使用すると、1つまたは複数のシードを暗号化して保存できます。各シードには独自のアカウント、トランザクション履歴、設定があります。"},{"id":"docs/wallets/0.1/trinity/concepts/hardware-wallet","name":"ハードウェアウォレット","summary":"A hardware wallet, sometimes referred to as cold storage, is a physical electronic device that stores your seed and signs bundles for you offline. If you create..."},{"id":"docs/wallets/0.1/trinity/concepts/node-quorum","name":"ノードクォーラム","summary":"トリニティをより堅牢にするために、ノードクォーラムから残高などの情報をリクエストし、結果を比較できます。トリニティでは、クォーラムはハードコードされたノード、リモートパブリックノード、および/またはユーザー定義のカスタムノードで構成されます"},{"id":"docs/wallets/0.1/trinity/how-to-guides/quickstart","name":"トリニティクイックスタート","summary":"このガイドを最初から最後まで完了すると、トリニティのインストールからトランザクションの送信、カスタムノードへの接続まで、すべてを学習できます。"},{"id":"docs/wallets/0.1/trinity/how-to-guides/verify-trinity-desktop","name":"デスクトップ版のダウンロードを検証する","summary":"トリニティのデスクトップ版をダウンロードするとき、IOTA 財団の GitHub リポジトリから正しいものをダウンロードしたことを確認するために、トリニティのデスクトップ版の信頼性を検証することができます。このガイドでは、トリニティのデスクトップ版のダウンロードを検証する方法を学びます。"},{"id":"docs/wallets/0.1/trinity/how-to-guides/create-an-account","name":"アカウントを作成する","summary":"トリニティアカウントはパスワードで保護されており、複数のシードをモバイル端末やコンピュータに安全に保管することができます。このガイドでは、新しいアカウントを作成します。"},{"id":"docs/wallets/0.1/trinity/how-to-guides/back-up-seed","name":"シードをバックアップする","summary":"トリニティは、デバイス上のシードを保護および保存します。その結果、モバイルデバイスまたはコンピューターを紛失した場合、シードは失われます。シード（および IOTA トークン）が失われないようにするには、シードをバックアップし、バックアップを安全な場所に保管する必要があります。このガイドでは、シードをバックアップする方法..."},{"id":"docs/wallets/0.1/trinity/how-to-guides/buy-iota","name":"トリニティで IOTA トークンを購入する","summary":"このガイドでは、MoonPay と呼ばれるサードパーティプロバイダーを介してトリニティで IOTA トークンを購入する方法を学習します。"},{"id":"docs/wallets/0.1/trinity/how-to-guides/send-a-transaction","name":"トランザクションを送信する","summary":"トリニティでは、アドレス、メッセージ、またはIOTAトークンの量を入力することにより、ノードにトランザクションを送信できます。このガイドでは、トリニティでトランザクションを送信する方法を学習します。"},{"id":"docs/wallets/0.1/trinity/how-to-guides/receive-a-transaction","name":"トランザクションを受信する","summary":"トランザクションを受信するには、新しいアドレスを生成して送信者に渡す必要があります。このガイドでは、トリニティで新しいアドレスを生成し、送信者に提供する形式を検討します。"},{"id":"docs/wallets/0.1/trinity/how-to-guides/create-a-qr-code","name":"トリニティが読み取れる QR コードを作成する","summary":"送信者にアドレスやメッセージなどのトランザクション情報を入力させないようにするために、トリニティのトランザクションフィールドに自動入力する QR コードを作成できます。このガイドでは、IOTA ユーティリティ Web サイトを使用して QR コードを作成します。"},{"id":"docs/wallets/0.1/trinity/how-to-guides/create-deep-link","name":"ディープリンクを作成する","summary":"ディープリンクは、トリニティを開いてトランザクションフィールドに自動入力するカスタマイズ可能なリンクです。ウェブサイトまたはEコマースプラットフォームにディープリンクを追加して、顧客にIOTA 支払いを迅速かつ簡単にすることができます。このガイドでは、ブラウザに入力すると、トリニティを開き、トランザクションの IOTA..."},{"id":"docs/wallets/0.1/trinity/how-to-guides/connect-to-a-custom-node","name":"カスタムノードに接続する","summary":"トリニティは、デフォルトノードのクォーラムを介してタングルと対話します。このガイドでは、自分自身のノードの1つをクォーラムに追加する方法、デブネットなどのカスタムノードのクォーラムに接続する方法、または特定のノードに接続してプルーフオブワークを外部委託する方法を学習します。"},{"id":"docs/wallets/0.1/trinity/how-to-guides/outsource-pow","name":"プルーフオブワークを外部委託する","summary":"デフォルトでプルーフオブワークは、トリニティを実行しているコンピューターで実行されます。このガイドでは、接続しているノードの1つにプルーフオブワークを行うように依頼する方法を学習します。"},{"id":"docs/wallets/0.1/trinity/how-to-guides/manage-your-account","name":"アカウントを管理する","summary":"デスクトップでアカウント設定にアクセスするには、バーガーメニュー > アカウント > アカウント設定に移動します。"},{"id":"docs/wallets/0.1/trinity/how-to-guides/manage-your-security-settings","name":"生体認証を設定する（モバイル端末のみ）","summary":"生体認証は、指紋を使用してトリニティにログインできるセキュリティプロセスです。このガイドでは、指紋またはパスワードのいずれかを使用してトリニティにログインする生体認証を設定します。\nBiometric authentication is a security process that allows you to log..."},{"id":"docs/wallets/0.1/trinity/how-to-guides/change-the-general-settings","name":"一般設定を変更する","summary":"一般設定では、ユーザーインターフェースの要素の変更、パスワードの変更、トリニティの接続先ノードの変更ができます。このガイドでは、一般設定を変更する方法を学びます。"},{"id":"docs/wallets/0.1/trinity/how-to-guides/auto-promote","name":"トランザクションの確定を助ける","summary":"トランザクションが確実に確定されるように、トリニティはトランザクションを自動促進（促進と再添付）できます。このガイドでは、自動促進設定を有効にする方法を学習します。"},{"id":"docs/wallets/0.1/trinity/how-to-guides/perform-a-snapshot-transition","name":"スナップショット移行を実行する","summary":"グローバルスナップショット中に、ノードは自身の台帳から古いトランザクションデータを削除してメモリを解放します。グローバルスナップショットの後、ノードは少なくとも1iの残高を持つアドレスのみを保持します。グローバルスナップショットの後に正しい残高が表示されない場合は、トリニティが最新の残高をリクエストできるように、スナッ..."},{"id":"docs/wallets/0.1/trinity/how-to-guides/develop-features-on-trinity","name":"トリニティ上で機能を開発する","summary":"アプリケーションだけでなく、トリニティは新しい機能を開発できるオープンソースプラットフォームです。このガイドでは、トリニティ用の自分自身の機能を開発する方法を学びます。\nAs well as an application, Trinity is an open-source platform on which you ..."},{"id":"docs/wallets/0.1/trinity/references/troubleshooting","name":"トラブルシューティング","summary":"問題の解決策が見つからない場合は、公式IOTA Discordのヘルプチャンネルでトリニティチームに連絡してください。"},{"id":"docs/wallets/0.1/hub/introduction/overview","name":"ハブ概要","summary":"Hub is a wallet management system for cryptocurrency exchanges. Through its application programming interfaces (APIs), Hub offers you an easy way to integrate I..."},{"id":"docs/wallets/0.1/hub/concepts/sweeps","name":"スウィープ","summary":"スウィープは、ユーザーの取り出しと預け入れの残高のバンドルです。ユーザーがIOTAトークンをアドレスに預け入れると、ハブはそれらのIOTAトークンを使用して取り出しリクエストを処理しようとします。"},{"id":"docs/wallets/0.1/hub/how-to-guides/quickstart","name":"Get started with Hub","summary":"If you're new to Hub, you can follow this workflow guide to start learning from the beginning."},{"id":"docs/wallets/0.1/hub/how-to-guides/configure-hub","name":"Plan your Hub configuration","summary":"Before you run Hub, you should consider whether you need to override some of its default settings to meet your needs. This guide gives you some advice about wha..."},{"id":"docs/wallets/0.1/hub/how-to-guides/install-hub","name":"ハブを実行する","summary":"ハブを実行することにより、アプリケーションがユーザーのアカウントを管理するために使用できるAPIを公開します。このガイドでは、ハブのインスタンスをインストールして実行します。"},{"id":"docs/wallets/0.1/hub/how-to-guides/secure-hub-api","name":"Secure the Hub API","summary":"ハブとアプリケーション間のAPI接続を保護するために、SSL暗号化を使用するようにハブを構成できます。このガイドでは、接続が暗号化されるようにハブAPIを保護します。"},{"id":"docs/wallets/0.1/hub/how-to-guides/install-the-signing-server","name":"署名サーバーをインストールする","summary":"ハブのセキュリティを向上させるために、バンドル署名操作とソルト（シードの生成に使用）をハブだけが接続できる署名サーバーに移動できます。このガイドでは、SSL暗号化接続を介してハブに接続する署名サーバーをインストールして実行します。"},{"id":"docs/wallets/0.1/hub/how-to-guides/get-started-with-the-grpc-api","name":"gRPC API入門","summary":"ハブは、任意のgRPCクライアントを使用して呼び出すことができるいくつかのgRPCメソッドを公開しています。これらの方法で、ハブデータベースおよびIOTAノードとやり取りすることでユーザーのIOTAトークンを管理できます。このガイドでは、新しい預け入れアドレスを持つ新しいユーザーを作成するためのgRPC APIの基本に..."},{"id":"docs/wallets/0.1/hub/how-to-guides/get-started-with-rest-api","name":"RESTful API入門","summary":"ハブのRESTful APIサーバーを公開すると、HTTPエンドポイントを介してハブと対話できます。これらのエンドポイントを使用すると、ハブデータベースおよびIOTAノードと対話することにより、ユーザーのIOTAトークンを管理できます。このガイドでは、RESTful APIの基本を学習して、新しい預け入れアドレスを持つ..."},{"id":"docs/wallets/0.1/hub/how-to-guides/query-the-database","name":"ハブデータベースをクエリする","summary":"ユーザーデータを追跡するために、ハブはユーザーデータをデータベーステーブルに保存します。これらのテーブルのデータの一部は、APIに公開されていません。たとえば、アドレスのシードUUIDを見つけて、シードを生成できます。このガイドでは、ハブデータベーステーブルのクエリを開始するための基本を示します。"},{"id":"docs/wallets/0.1/hub/how-to-guides/create-a-demo-exchange","name":"デモ取引所を作成する","summary":"ハブをアプリケーションに統合する方法を理解できるように、このガイドでは、偽の取引所のサーバー側でハブAPI呼び出しを行うプロセスを説明します。このガイドの最後には、IOTAトークンを預け入れてから取り出すことが可能なデモ取引所があります。"},{"id":"docs/wallets/0.1/hub/how-to-guides/integrate-hub","name":"統合オプション","summary":"オプション1. ハブでユーザーの残高を管理する（デフォルト）： トレードとユーザー残高を管理する最も簡単な方法"},{"id":"docs/wallets/0.1/hub/how-to-guides/recover-tokens","name":"使用済みアドレスからIOTAトークンをリカバーする","summary":"ユーザーがスウィープに既に含まれている使用済みアドレスにIOTAトークンを預け入れる場合があります。この場合、攻撃者が署名をブルートフォースしてIOTAトークンを盗もうとするリスクがあります。使用済みアドレスからIOTAトークンをリカバーするために、潜在的な攻撃者ができる前にIOTAトークンを新しいアドレスに転送しよう..."},{"id":"docs/wallets/0.1/hub/references/grpc-api-reference","name":"APIリファレンス","summary":"ハブには、タングルおよびハブデータベースへの接続を簡素化するgRPC APIがあります。このAPIリファレンスを使用して、メソッドを見つけ、メソッドが行うことを学びます。"},{"id":"docs/wallets/0.1/hub/references/restful-api-reference","name":"RESTful APIリファレンス","summary":"Hubには、タングルおよびハブデータベースへの接続を簡素化するRESTful APIがあります。このAPIリファレンスを使用して、エンドポイントを見つけ、それらの機能を学習します。"},{"id":"docs/wallets/0.1/hub/references/command-line-options","name":"コマンドラインオプション","summary":"ハブまたは署名サーバーを起動すると、コマンドラインオプションを使用してデフォルト設定を上書きできます。"},{"id":"docs/wallets/0.1/hub/references/database-tables","name":"データベーステーブル","summary":"ハブは、預け入れアドレスや取り出しリクエストなどの情報をデータベーステーブルに記録することによって、ユーザーのIOTAトークンを管理します。この情報は、APIを使用するか、データベースサーバーに問い合わせることによって見つけることができます。"},{"id":"docs/wallets/0.1/hub/references/troubleshooting","name":"トラブルシューティング","summary":"APIを使い始めるでgRPCクライアントを実行しようとすると、このエラーが表示されることがあります。"},{"id":"docs/utils/0.1/introduction/overview","name":"ユーティリティ","summary":"ユーティリティは、オープンソースのアプリケーションまたはツールであり、使用することも、適応させることも、自分のアプリケーションに組み込むこともできます。"},{"id":"docs/utils/0.1/community/mam-watcher/overview","name":"MAMウォッチャー概要","summary":"MAM（マスク認証メッセージング）は、チャネルと呼ばれる暗号化されたデータストリームを発行および購読することを可能にする通信プロトコルです。MAMウォッチャーを使用すると、チャネル上で暗号化されたメッセージに署名して送信し、そのチャネルを購読してメッセージを検証、復号化、および読み取ることができます。"},{"id":"docs/utils/0.1/community/one-command-tangle/overview","name":"ワンコマンドプライベートタングル","summary":"このアプリケーションを使用すると、単一のDockerコマンドを使用して独自のIOTAネットワークを設定できます。このコマンドを実行すると、独自のIOTAテストネットワークと2.7Pi（最大量）のテストIOTAトークンが作成されます。このアプリケーションを使用して、金銭的価値を危険にさらすことなく、アイデアやアプリケーシ..."},{"id":"docs/utils/0.1/community/raspberry-pi-pub-sub/overview","name":"Raspberry Piセンサーデータパブリッシャー","summary":"このアプリケーションは、Raspberry PiからDevnetタングルに毎分リアルタイムの温度データ（現在の摂氏温度）を送信します。その後、別のDevnetノードでイベントストリーム（ZMQ）を購読し、データを受信したときに知らせるメッセージを表示します。"},{"id":"docs/utils/0.1/official/iota-area-codes/overview","name":"IOTAエリアコード概要","summary":"IOTAエリアコード（IAC）は、IOTAトランザクションを地理的位置でタグ付けするための標準規格として提案されています。"},{"id":"docs/utils/0.1/official/proof-of-existence/overview","name":"存在証明プロバイダー概要","summary":"ファイルは、さまざまな関係者間で契約などの情報を転送するために重要です。時には、ある関係者が他の関係者達が知らないうちにファイルを変更することがあります。したがって、すべての関係者が、ファイルが変更されていないことを確実に証明して、信頼できるようにする方法が必要です。ファイルが変更されていないことを証明するために、存在..."},{"id":"docs/utils/0.1/official/tangle-certificate/overview","name":"タングル証明書作成者の概要","summary":"証明書は、所有者に関する事実を証明する公式文書です。しかし、証明書がデジタルの場合、それらは詐欺の対象となります。デジタル証明書はコピーおよび編集できるため、確実性と信用性に影響します。証明書が本物であり、信頼でき、変更されていないことを証明するために、証明書をタングルに添付することができます。"},{"id":"docs/utils/0.1/official/tryte-compress/overview","name":"トライトコンプレッサー概要","summary":"トランザクションのバンドルをノードに送信すると、送信したトランザクションがネットワークの残りの部分に届かない場合があり、トランザクションが確定されないことがあります。たとえば、ノードは、トランザクションを隣接ノードに転送する前にオフラインになる場合があります。そのため、後でトランザクションを再ブロードキャストまたは再添..."},{"id":"docs/blueprints/0.1/introduction/overview","name":"アプリケーション設計図","summary":"アプリケーション設計図では、IOTAを使用して実際の問題を解決し、明確に定義されたビジネスニーズをサポートする方法について説明しています。"},{"id":"docs/blueprints/0.1/data-marketplace/overview","name":"データマーケットプレイス","summary":"データサイロにより、異なるデータポイント間でデータを売買することが難しくなります。 この課題を克服するために、データマーケットプレイスはマスクされた認証済みメッセージング（Masked Authenticated Messaging, MAM）チャネルを使用してデータサイロを開き、ユーザーがデータと引き換えにIOTAト..."},{"id":"docs/blueprints/0.1/data-marketplace/architecture","name":"アプリケーションアーキテクチャ","summary":"データマーケットプレイスアプリケーションは、センサー、クラウドバックエンド、およびIOTAタングルを使用してデータをMAMチャネルに公開します。"},{"id":"docs/blueprints/0.1/data-marketplace/deployment-and-testing","name":"データマーケットプレイスアプリをデプロイしてテストする","summary":"データマーケットプレイスでデータストリームの売買を開始するには、自身のアプリケーションをデプロイするか、デモアプリケーションでテストします。"},{"id":"docs/blueprints/0.1/doc-immutability/overview","name":"ドキュメントの不変性の概要","summary":"ドキュメントは、当事者間で情報や契約を転送するための重要な手段です。ドキュメントが確立された状態から変更されていないことを確実に証明できることは、当事者を保護するだけでなく、当事者間の信頼を確保するのに役立ちます。この設計図は、IOTAタングルを使用して以前に署名された文書の署名を自動的にチェックするソリューションを説..."},{"id":"docs/blueprints/0.1/doc-immutability/architecture","name":"アプリケーションアーキテクチャ","summary":"ドキュメントの不変性アプリケーションは、Reactで書かれたグラフィカルユーザーインターフェース（GUI）とNodeJSで書かれたバックエンドAPIの2つの部分から構成されています。"},{"id":"docs/blueprints/0.1/p2p-energy/overview","name":"P2Pエネルギーグリッド","summary":"エネルギーの供給はしばしば自動化されていますが、支払いシステムは統合するのに費用がかかり、そしてしばしば手動の介入を必要とします。IOTAを使用してピアツーピア（P2P）エネルギーグリッドを作成することで、電力の転送とその電力に対する支払いを自動化できます。この自動化により、インフラストラクチャはより動的になり、更新が..."},{"id":"docs/blueprints/0.1/p2p-energy/architecture","name":"アプリケーションアーキテクチャ","summary":" P2Pエネルギーグリッドアプリケーションは、IOTAネットワーク内のノードを通じて、電力源、生産者、消費者、およびグリッドからのデータをMAMチャネルに公開します。"},{"id":"docs/blueprints/0.1/p2p-energy/deployment-and-testing","name":"P2Pエネルギーグリッドアプリをデプロイする","summary":"P2Pエネルギーグリッドアプリケーションの使用を開始するには、自身のアプリケーションをデプロイします。"},{"id":"docs/blueprints/0.1/tangle-data-storage/overview","name":"タングルデータストレージ概要","summary":"データは、官民組織のイノベーションを促進し、新たな収益源を生み出すために使用することができます。しかし、ベンダーに依存しないデータ検証方法がなければ、データを信頼することはできません。この設計図では、IOTAタングルをイミュータブルなデータ構造として使用し、サードパーティのストレージソリューション内のファイルの内容を検..."},{"id":"docs/blueprints/0.1/tangle-data-storage/architecture","name":"アプリケーションアーキテクチャ","summary":"タングルデータストレージアプリケーションは、Reactで書かれたグラフィカルユーザーインターフェース（GUI）とNodeJSで書かれたバックエンドAPIの2つの部分から構成されています。"},{"id":"docs/blueprints/0.1/tangle-data-storage/deployment-and-testing","name":"タングルデータストレージアプリをデプロイしてテストする","summary":"IPFSノードとタングルにデータの保存を開始するには、アプリケーションをデプロイし、IOTA財団のグラフィカルユーザーインターフェースを使用してファイルデータをアップロードし、ファイルデータを取得し、ハッシュを比較して内容を確認します。"},{"id":"docs/blueprints/0.1/track-and-trace/overview","name":"トラック&トレース概要","summary":"デューデリジェンスとベンダーに依存しないデータソースの両方が欠如しているため、流通ネットワーク内の回収可能アセットは多くの場合、元の所有者に返却されません。この設計図では、IOTAタングルおよび他のIOTAテクノロジを使用して、IBCSグループが回収可能アセットの回収のためのトラック&トレースシステムをどのように実施し..."},{"id":"docs/blueprints/0.1/track-and-trace/architecture","name":"アプリケーションアーキテクチャ","summary":"トラック&トレースアプリケーションはIOTA MAMプロトコルを使用して、回収可能アセットにIDを付与し、MAMチャネルと呼ばれるトランザクションのストリームで回収可能アセットを追跡します。"},{"id":"docs/blueprints/0.1/track-and-trace/deployment-and-testing","name":"トラック&トレースアプリをデプロイしてテストする","summary":"タングルでデータの追跡を開始するには、アプリケーションをデプロイし、IOTA財団のGUIを使用してアセットを検索してアップロードします。"},{"id":"docs/iot/0.1/introduction/overview","name":"IoT projects overview","summary":"The Internet of Things (IoT) is an umbrella term for billions of Internet-connected devices that share data with each other. Thanks to this data-sharing network..."},{"id":"docs/iot/0.1/esp32/introduction/get-started","name":"Get started with the ESP32","summary":"ESP32 microcontrollers are an ideal solution for applications that need to connect to WiFi or Bluetooth. In this guide, you learn how to get started with the ES..."},{"id":"docs/iot/0.1/esp32/iota-projects/create-a-wallet","name":"Run a command-line wallet on an ESP32","summary":"In this guide, you set up an IOTA wallet that allows you to send transactions from the command-line on an ESP32."},{"id":"docs/iot/0.1/esp32/iota-projects/generate-address","name":"Run an address monitor on an ESP32","summary":"In this guide, you set up a cashier application that allows you to display the QR code for an address on an LCD screen. This application can also monitor the ba..."},{"id":"docs/iot/0.1/nrf52/introduction/get-started","name":"Get started with the nRF52","summary":"The nRF52-series of microcontrollers are an ideal solution for wearables, toys, smart home devices and appliances, and wireless charging. We use this series of ..."},{"id":"docs/iot/0.1/nrf52/setup-guides/install-arm-gcc-toolchain","name":"ARM GCCツールチェーンをインストールする","summary":"ARMツールチェーンを使用すると、マイクロコントローラーで実行できるマシンコードにコードをコンパイルできます。"},{"id":"docs/iot/0.1/nrf52/setup-guides/connect-bosch-sensor","name":"Connect to a Bosch BME/BMP 280 sensor","summary":"The Bosch BME/BMP 280 sensors are developed specifically for mobile applications where size and low power consumption are key design constraints. In this guide,..."},{"id":"docs/iot/0.1/nrf52/setup-guides/connect-programmer","name":"Connect to an external programmer","summary":"To transfer machine code onto a microcontroller, you need a programmer, and not all microcontrollers have an integrated one. In this guide, you connect an exter..."},{"id":"docs/iot/0.1/nrf52/setup-guides/connect-to-serial-interface","name":"Connect to the microcontroller's serial interface","summary":"To read the output of your microcontroller, you need to be able to receive and transmit data on its serial port through a USB-to-UART connector. Some microcontr..."},{"id":"docs/iot/0.1/nrf52/how-to-guides/read-sensor-data","name":"マイクロコントローラーからセンサーデータを読み取る","summary":"このガイドでは、nRF52シリーズマイクロコントローラーに接続されているセンサーからデータを読み取ることができる低予算のアプリケーションを作成します。"},{"id":"docs/iot/0.1/nrf52/how-to-guides/set-up-a-bluetooth-star-network","name":"Set up a Bluetooth star network","summary":"Star networks are useful for setting up sensor server networks that communicate through a border router. In this guide, you set up a 6LoWPAN over Bluetooth Low-..."},{"id":"docs/iot/0.1/nrf52/iota-projects/run-an-environment-to-tangle-app","name":"センサーデータをタングルに添付する","summary":"このガイドでは、環境センサーデータを収集し、マスクされた認証済みメッセージング（Masked Authenticated Messaging, MAM）を使用してタングルに添付するアプリケーションを実行します。"},{"id":"docs/iot/0.1/sbc/introduction/get-started","name":"Get started with single-board computers","summary":"A single-board computer (SBC) is a small computer in which a single circuit board includes memory, input/output ports, a microprocessor and any other necessary ..."},{"id":"docs/iot/0.1/sbc/how-to-guides/install-go-on-sbc","name":"LinuxデバイスにGo言語をインストールする","summary":"Goプログラミング言語を使用するアプリケーションを作成または実行するには、Goプログラミング言語をインストールする必要があります。"},{"id":"docs/smartcity/0.1/introduction/overview","name":"IOTAスマートシティ設計図","summary":"AstroPiOTAは、タングルを使用してローカル環境データを追跡するためにMAMに接続されている国際宇宙ステーションからのAstroPiのクローンです。地球上で、AstroPiOTAはローカルの天気予報を理解し報告するのを助け、地震予知に役立つかもしれません。"},{"id":"docs/smartcity/0.1/astropiota/introduction/overview","name":"AstroPiOTA","summary":"AstroPiOTAはAstroPiのクローンです。AstroPiは、ISS（国際宇宙ステーション）でRaspberry Piを使用して、宇宙飛行士が自分の環境について最新の情報を入手できるようにしたプロジェクトです。 AstroPiは、温度、湿度、その他のデータを検知するためにRaspberry PiコンピュータとS..."},{"id":"docs/smartcity/0.1/astropiota/how-to-guides/build","name":"自分のAstroPiOTAをビルドする","summary":"AstroPiOTAを実行するには、正しいハードウェアとRaspberry Pi用のオペレーティングシステムが必要です。"},{"id":"docs/smartcity/0.1/astropiota/how-to-guides/run","name":"AstroPiOTAを実行する","summary":"以下の手順は、オペレーティングシステムが設定されていることを前提としています。このインストールには複数のコンポーネントがあるため、それらを組み合わせる前に各コンポーネントが個別に機能することを確認するためのスクリプトが含まれています。"},{"id":"docs/smartcity/0.1/astropiota/how-to-guides/connect","name":"SSHでRaspberry Piに接続する","summary":"モニターやキーボードなしでAstroPiOTAを実行したい場合は、SSHを介して対話するためにAstroPiOTAのネットワークアドレスが必要です。Raspberry PiのIPアドレスを見つけるには、Pythonスクリプトを使用できます。"},{"id":"docs/smartcity/0.1/astropiota/how-to-guides/customize","name":"AstroPiOTAをカスタマイズする","summary":"AstroPiOTA送信者はSense HATからセンサーデータを収集し、センサーデータをスクロールマーキーに公開し、センサーデータをJSON形式でタングルのMAMチャネルに送信します。AstroPiOTA受信者はMAMチャネルを監視してセンサーデータをリッスンします。これらのファイルの両方をカスタマイズして、Astr..."},{"id":"docs/smartcity/0.1/astropiota/references/sensehat-specs","name":"Sense HAT仕様","summary":"このリストには、AstroPiOTAプロジェクトで使用されているSense HATハードウェアの仕様が含まれています。"},{"id":"docs/general/0.1/introduction/overview","name":"一般概要","summary":"IOTA は、暗号化された方法でデータと価値を転送することを可能にするプロトコルです。そのため、IOTA は多くの環境で使用できますが、そのうちのいくつかは以前にセットアップしたことも使ったこともないかもしれません。"},{"id":"docs/general/0.1/how-to-guides/expose-your-local-device","name":"ローカルデバイスをインターネットに公開する","summary":"デバイスをローカルネットワークの外部に接続するには、デバイスをインターネットに公開する必要があります。ローカルデバイスをインターネットに公開する一般的な理由は、IOTA ノードを隣接ノードに接続することです。"},{"id":"docs/general/0.1/how-to-guides/set-up-virtual-machine","name":"仮想マシン上に Linux サーバーをセットアップする","summary":"多くのガイドには Linux オペレーティングシステムが必要です。デバイスで別のオペレーティングシステムを実行している場合、仮想マシン内で Linux を使用できます。"},{"id":"docs/general/0.1/how-to-guides/setup-sbc","name":"シングルボードコンピュータを設定する","summary":"シングルボードコンピュータ（SBC）は、単一の回路基板がメモリ、入力/出力ポート、マイクロプロセッサおよび他の必要な機能を含む小型のコンピュータです。SBC は、デスクトップなどのマルチボードコンピュータよりも軽量、コンパクト、信頼性が高く、電力効率もはるかに優れています。IOTA テクノロジーを使用する専用の組み込み..."},{"id":"docs/general/0.1/references/troubleshooting","name":"トラブルシューティング","summary":""},{"id":"docs/contribution/0.1/style-guide","name":"ドキュメントスタイルガイド","summary":"IOTAの知識を持つすべての人に、ドキュメントに貢献することをお勧めします。ドキュメントについて議論するには、Discordの#documentation-discussionチャンネルに参加してください。"}]

